import Men from "../Cloth/Men";
import Women from "../Cloth/Women";
import Electroni from "../Cloth/Electroni";
import Home from "../Cloth/Home";
import Jewelery from "../Cloth/Jewelery";
import axios from "axios";
import Nav from "./Nav";
import { useEffect, useState } from "react";
import { BrowserRouter, Route, Routes } from "react-router-dom";

export default function App2(){
    const [book,setbook]=useState([])
    useEffect(()=>{
        axios.get('https://anapioficeandfire.com/api/books')
        .then(res=>setbook(res.data))
    },[])
    return(
    <BrowserRouter>
        <Nav />
        <Routes>
            <Route path={'/'} element={<Home book={book} />} />
        </Routes>
    </BrowserRouter>
    )
}
